import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Start from './pages/Start';

function App() {
  return (
    <div className="App">
     <Router>
          <Routes>
            <Route path="/" element={<Start />} />
          </Routes>
        </Router>
    </div>
  );
}

export default App;
